export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},pqRYhBbaUW:{data:{id:400,attributes:{imdbId:"tt0787474",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQxODA5MDkyNV5BMl5BanBnXkFtZTgwMDMyNjkzMjE@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:1063,attributes:{title:"The Boxtrolls",plot:"THE BOXTROLLS are a community of quirky, mischievous creatures who have lovingly raised an orphaned human boy named Eggs in the amazing cavernous home they've built beneath the streets of a city called Cheesebridge. The story is about a young orphaned boy raised by underground cave-dwelling trash collectors who tries to save his friends from an evil exterminator, the town's villain, Archibald Snatcher. When Snatcher comes up with a plot to get rid of the Boxtrolls. Eggs decides to venture above ground and \"into the light,\" where he meets and teams up with fabulously feisty Winnie. Together, they devise a daring plan to save The BoxTrolls family. The film is based upon the children's novel 'Here Be Monsters' by Alan Snow.",slug:"the-boxtrolls"}}},books:{data:[{id:596,attributes:{title:g,description:"Meet the Boxtrolls! The book that inspired the film! There's an emergency in Ratbridge! Only orphan Arthur and his new friends Willbury Nibble QC, Marjorie the inventor, a timid cabbagehead, and some very excitable boxtrolls can save the day! But are they really up to the job? Why has the evil Snatcher taken up residence in Cheese Hall? Who has stolen Marjorie's latest invention? And who knew that rats were so good at removing stains? Find out in this amazing, fun, and highly-illustrated romp!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5tfuBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2014-09-11",publisher:"Oxford University Press - Children",subtitle:b}},{id:597,attributes:{title:g,description:"Entertaining antics and skullduggery abound in the book that inspired Laika Studio’s animated film The Boxtrolls, in theaters September 26, 2014! Welcome to Ratbridge. But beware—for there is skulduggery afoot. Young Arthur has fallen foul of the appalling outlaw, Snatcher, and is trapped alone in the town with every way home sealed. Meanwhile Snatcher and his men are working tirelessly in secret on a fiendish and dastardly plan to destroy the entire town. With the help of some friendly boxtrolls and cabbageheads, some quirkly townspeople, and the rats and pirates from the Ratbridge Nautical Laundry, can Arthur thwart Snatcher’s evil plans and find his way home?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UIDbR1tacT8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2010-05-11",publisher:h,subtitle:b}},{id:598,attributes:{title:"Worse Things Happen at Sea",description:"All aboard the Nautical Laundry! Arthur and his friends are about to embark on a journey to faraway shores in search of the missing secret ingredient needed for the Black Jollop miracle medicine. It's excitement ahoy as the motley crew sets sail on the high seas of adventure!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Z0HEoQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2014-04-16",publisher:b,subtitle:b}},{id:599,attributes:{title:"Worse Things Happen at Sea!",description:"A miracle medicine shortage prompts young Arthur and his Ratbridge friends to set sail aboard the famed rat-pirate vessel Nautical Laundry in search of rare ingredients only to encounter unexpected challenges and an attack at sea.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wX9BSvWp5LYC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2013-07-09",publisher:h,subtitle:"A Tale of Pirates, Poison, and Monsters"}},{id:600,attributes:{title:"Here Be Monsters Part 3: Cheese Galore!",description:"There is trouble in Ratbridge - both above ground in the town and underground, where the boxtrolls and cabbageheads live. And the awful Snatcher has plans to make the trouble oh so very much worse... Can Arthur and his friends summon up all their cunning and save the day? With nearly two hundred incredible black and white drawings, this is the third part of Alan Snow's astonishing illustrated journey into the unbelievably weird world of Ratbridge.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MP4ZGgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2008-05-01",publisher:"OUP Oxford",subtitle:b}}]}}},meta:{}}},prerenderedAt:1681377229896}}("Alan Snow","","movie",null,"series",1,"Here Be Monsters!","Simon and Schuster"))